import React from 'react';
import './contact.css';
import SideMenu from './SideMenu';
const Contact = () => {
  return (
    <div className="contact-container">
      <h2>Contact Us</h2>
      <p>If you have any queries, feel free to reach out to us:</p>
      <p>Email: <a href="mailto:support@flightapptvm.com">support@flightapptvm.com</a></p>
      <p>Contact Number
        +1-800-555-5555</p>
      <p>
      <h2>Address</h2>
      Thiruvananthapuram International Airport, Airport Rd, Chackai, Thiruvananthapuram, Kerala Pincode: 695024
Feedback.trv@adani.com
Contact Number
Domestic : 0471-2702311
International: 0471-2702711/10
Safety Investigation coordinator (SIC)
Mr. Lijo Varghese
      </p>
      <div><SideMenu/></div>
    </div>
  );
};

export default Contact;
export {SideMenu};
